import { FiEdit3 } from 'react-icons/fi';

function PostTitle({ nick }) {
  const defaultTitle = `${nick}의 이유식일기`;
  const editBtn = document.createElement('button');
  editBtn.className = 'title-edit-btn';

  return (
    <>
      {defaultTitle}
      <FiEdit3 />
    </>
  );
}

export default PostTitle;
